import React, { Component } from "react";
import { Button, CloseButton, Modal } from "react-bootstrap";
import Axios from "axios";
import DatePicker from "react-datepicker";
import GetAuthorisation from "../../Funciton/GetAuthorisation";
import SuccessAlert from "../Alerts/SuccessfulAlert";
import UnsuccessAlert from "../Alerts/UnsuccessfulAlert";
import { Redirect } from "react-router-dom";
import { confirmAlert } from 'react-confirm-alert';
import "../card-components/card.styles.css"
import ConfirmModal from "./ConfirmModal";
import AddAppointmentModal from "./AddAppointmentModal"
import PharmaciesForEmployee from "./PharmaciesForEmployeeModal";
import RemovePharmacistModal from "./RemovePharmacistModal";
const API_URL="http://localhost:8080";

class PriceModal extends Component {
	state = {
		modalSize: "lg",
	
    
	};

   

	handleClickOnClose = () => {
		this.setState({
			modalSize: "lg",
		});
		this.props.onCloseModal();
	};




	render() {
        
		return (
			<Modal
				show={this.props.show}
				size={this.state.modalSize}
				centered
                
			>
				<Modal.Header>
					<Modal.Title style={{ marginLeft: "38%" }} >
						{this.props.header}
					</Modal.Title>
				</Modal.Header>
				<Modal.Body>
			
               
					<div>
						

						<table border="1" style={{ width: "100%" }}>
							<tr>
								<th>Usluga</th>
								<th>Cena</th>
							</tr>
							{this.props.workTimes.map((workTime) => (
								<tr>
									<td>{workTime.EntityDTO.pharmacyName}</td>
									<td>{workTime.EntityDTO.endTime}</td>
								</tr>
							))}
						</table>

                       

                        
                        
					</div>
                   
                </Modal.Body>
				<Modal.Footer>
                    <Button onClick={() => this.handleClickOnClose()}>Zatvori</Button>
				</Modal.Footer>
			</Modal>



		);
	}
}

export default PriceModal;
